import './App.css';
import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

function App() {
  const [cafes, setCafes] = useState([]);

  // Simula un inicio de sesión exitoso (cambia esto por tu lógica real de inicio de sesión)
  const loginSuccessful = true;

  useEffect(() => {
    if (loginSuccessful) {
      // Hacer una solicitud al servidor para obtener la lista de cafés
      axios.get('URL_DEL_BACKEND')
        .then((response) => {
          setCafes(response.data);
        })
        .catch((error) => {
          console.error('Error al obtener la lista de cafés:', error);
        });
    }
  }, [loginSuccessful]);

  return (
    <div className="container mt-5">
      {loginSuccessful ? (
        <div>
          <h1>Listado de Cafés</h1>
          <table className="table">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">Nombre</th>
                <th scope="col">Tipo</th>
                <th scope="col">Región</th>
              </tr>
            </thead>
            <tbody>
              {cafes.map((cafe, index) => (
                <tr key={index}>
                  <th scope="row">{index + 1}</th>
                  <td>{cafe.nombre}</td>
                  <td>{cafe.tipo}</td>
                  <td>{cafe.region}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <p>Debes iniciar sesión para ver la lista de cafés.</p>
      )}
    </div>
  );
}

export default App;
